\u0433\u043e\u0434\">1866<\/a>&#160;\u2014 \u0417\u0430\u043a\u043e\u043d \u043e \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0438\u0445 \u043f\u0440\u0430\u0432\u0430\u0445 \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u0438\u043b \u0432\u0441\u0435\u043c \u0436\u0438\u0442\u0435\u043b\u044f\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u0440\u0430\u0432\u043d\u044b\u0435 \u043f\u0440\u0430\u0432\u0430 (\u0438\u0441\u043a\u043b\u044e\u0447\u0430\u044f \u0438\u043d\u0434\u0435\u0439\u0446\u0435\u0432, \u0436\u0438\u0432\u0443\u0449\u0438\u0445 \u0432 \u0440\u0435\u0437\u0435\u0440\u0432\u0430\u0446\u0438\u044f\u0445 \u0438\u043b\u0438 \u043d\u0430 \u043d\u0435\u0437\u0430\u0441\u0435\u043b\u0451\u043d\u043d\u044b\u0445 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u044f\u0445 ).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1870_%D0%B3%D0%BE%D0%B4\" title=\"1870 \u0433\u043e\u0434\">1870<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D1%86%D1%88%D0%B5,_%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85\" title=\"\u041d\u0438\u0446\u0448\u0435, \u0424\u0440\u0438\u0434\u0440\u0438\u0445\">\u0424\u0440\u0438\u0434\u0440\u0438\u0445 \u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c \u041d\u0438\u0446\u0448\u0435<\/a> \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d \u043d\u0430 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u044c \u043e\u0440\u0434\u0438\u043d\u0430\u0440\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u043e\u0440\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B7%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D