a\u0430\u043c\u0438<\/a> \u0432\u0437\u044f\u0442 \u0448\u0442\u0443\u0440\u043c\u043e\u043c \u0433\u043e\u0440\u043e\u0434-\u043a\u0440\u0435\u043f\u043e\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%91%D0%BD%D0%B8%D0%B3%D1%81%D0%B1%D0%B5%D1%80%D0%B3\" title=\"\u041a\u0451\u043d\u0438\u0433\u0441\u0431\u0435\u0440\u0433\">\u041a\u0451\u043d\u0438\u0433\u0441\u0431\u0435\u0440\u0433<\/a>, \u043d\u044b\u043d\u0435\u0448\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BB%D0%B8%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4\" title=\"\u041a\u0430\u043b\u0438\u043d\u0438\u043d\u0433\u0440\u0430\u0434\">\u041a\u0430\u043b\u0438\u043d\u0438\u043d\u0433\u0440\u0430\u0434<\/a>. \u041a\u043e\u043c\u0435\u043d\u0434\u0430\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8F%D1%88,_%D0%9E%D1%82%D1%82%D0%BE\" title=\"\u041b\u044f\u0448, \u041e\u0442\u0442\u043e\">\u041e\u0442\u0442\u043e \u041b\u044f\u0448<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b \u0430\u043a\u0442 \u043e \u043a\u0430\u043f\u0438\u0442\u0443\u043b\u044f\u0446\u0438\u0438 \u0433\u043e\u0440\u043e\u0434\u0430.<\/li><li>\u0417\u0430 \u0443\u0447\u0430\u0441\u0442\u0438\u0435 \u0432 \u0437\u0430\u0433\u043e\u0432\u043e\u0440\u0435 \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D1%82%D0%BB%D0%B5%D1%80,_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84\" title=\"\u0413\u0438\u0442\u043b\u0435\u0440, \u0410\u0434\u043e\u043b\u044c\u0444\">\u0413\u0438\u0442\u043b\u0435\u0440\u0430<\/a> \u0432 \u043a\u043e\u043d\u0446\u043b\u0430\u0433\u0435\u0440\u0435 \u0424\u043b\u043e\u0441\u0441\u0435\u043d\u0431\u044e\u0440\u0433 \u043f\u043e\u0432\u0435\u0448\u0435\u043d \u0433\u043b\u0430\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D0%B2%D0%B5%D1%80\" title=\"\u0410\u0431\u0432\u0435\u0440\">\u0430\u0431\u0432\u0435\u0440\u0430<\/a> \u0430\u0434\u043c\u0438\u0440\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D1%80%D0%B8%D1%81,_%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC_%D0%A4%D1%80%D0%B0%D0%BD%D1%86\" title=\"\u041a\u0430\u043d\u0430\u0440\u0438\u0441, \u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c \u0424\u0440\u0430\u043d\u0446\">\u041a\u0430\u043d\u0430\u0440\u0438\u0441<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442\u043e \u0437\u0430\u043a\u0440\u044b\u0442\u043e\u0435 \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%BE%D0%B2_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0421\u043e\u0432\u0435\u0442 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0421\u0421\u0421\u0420\">\u0421\u043e\u0432\u0435\u0442\u0430 \u041c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0421\u0421\u0421\u0420<\/a> \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0442\u043e\u0440\u0441\u043a\u043e\u0433\u043e \u0431\u044e\u0440\u043e \u041a\u0411-11 \u043f\u0440\u0438 \u041b\u0430\u0431\u043e\u0440\u0430\u0442\u043e\u0440\u0438\u0438 \u2116&#160;2 \u0410\u041d \u0421\u0421\u0421\u0420. \u041d\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0435 \u041d\u0438\u0436\u0435\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u0438 \u041c\u043e\u0440\u0434\u043e\u0432\u0438\u0438 \u0432 \u0441\u0430\u0440\u043e\u0432\u0441\u043a\u0438\u0445 \u043b\u0435\u0441\u0430\u0445 \u043f\u043e\u044f\u0432\u0438\u043b\u0430\u0441\u044c \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u043f\u043e \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u043a\u0435 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u044f\u0434\u0435\u0440\u043d\u043e\u0433\u043e \u043e\u0440\u0443\u0436\u0438\u044f, \u0431\u043e\u043b\u0435\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0430\u044f \u043f\u043e\u0434 \u0438\u043c\u0435\u043d\u0435\u043c \u0410\u0440\u0437\u0430\u043c\u0430\u0441-16 \u0438 \u043d\u043e\u0441\u044f\u0449\u0430\u044f \u0441\u0435\u0433\u043e\u0434\u043d\u044f \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u044f\u0434\u0435\u0440\u043d\u044b\u0439 \u0446\u0435\u043d\u0442\u0440&#160;\u2014 \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u041d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u044d\u043a\u0441\u043f\u0435\u0440\u0438\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u043e\u0439 \u0444\u0438\u0437\u0438\u043a\u0438 (\u0420\u0424\u042f\u0426&#160;\u2014 \u0412\u041d\u0418\u0418\u042d\u0424).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B7%D0%BD%D1%8F_%D0%B2_%D0%94%D0%B5%D0%B9%D1%80-%D0%AF%D1%81%D0%B8%D0%BD%D0%B5\" title=\"\u0420\u0435\u0437\u043d\u044f \u0432 \u0414\u0435\u0439\u0440-\u042f\u0441\u0438\u043d\u0435\">\u0420\u0435\u0437\u043d\u044f \u0432 \u0414\u0435\u0439\u0440-\u042f\u0441\u0438\u043d\u0435<\/a>: \u0441\u043e\u0431\u044b\u0442\u0438\u044f, \u0432 \u0445\u043e\u0434\u0435 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0430\u0440\u0430\u0431\u0441\u043a\u0430\u044f \u0434\u0435\u0440\u0435\u0432\u043d\u044f \u0414\u0435\u0439\u0440-\u042f\u0441\u0438\u043d \u0431\u044b\u043b\u0430 \u0437\u0430\u0445\u0432\u0430\u0447\u0435\u043d\u0430 \u0435\u0432\u0440\u0435\u0439\u0441\u043a\u0438\u043c\u0438 \u043d\u0435\u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u044b\u043c\u0438 \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u044b\u043c\u0438 \u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f\u043c\u0438 \u0418\u0440\u0433\u0443\u043d \u0438 \u041b\u0435\u0445\u0438, \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0430\u0432\u0448\u0438\u043c\u0438 \u043a \u0440\u0430\u0434\u0438\u043a\u0430\u043b\u044c\u043d\u044b\u043c \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f\u043c \u0441\u0438\u043e\u043d\u0438\u0441\u0442\u043e\u0432-\u0440\u0435\u0432\u0438\u0437\u0438\u043e\u043d\u0438\u0441\u0442\u043e\u0432. \u0412\u043e \u0432\u0440\u0435\u043c\u044f \u0437\u0430\u0445\u0432\u0430\u0442\u0430 \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043e\u0436\u0435\u0441\u0442\u043e\u0447\u0435\u043d\u043d\u044b\u0445 \u0441\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0439 \u0431\u044b\u043b\u043e \u0443\u0431\u0438\u0442\u043e, \u043f\u043e \u0440\u0430\u0437\u043d\u044b\u043c \u043e\u0446\u0435\u043d\u043a\u0430\u043c, \u043e\u0442 107 \u0434\u043e 254 \u0436\u0438\u0442\u0435\u043b\u0435\u0439 \u0434\u0435\u0440\u0435\u0432\u043d\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954<\/a>&#160;\u2014 \u041e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u0430 \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D0%BB%D1%8E%D1%81-3\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441-3\">\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441-3<\/a>\u00bb \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D1%91%D1%88%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D0%A4%D1%91%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0422\u0440\u0451\u0448\u043d\u0438\u043a\u043e\u0432, \u0410\u043b\u0435\u043a\u0441\u0435\u0439 \u0424\u0451\u0434\u043e\u0440\u043e\u0432\u0438\u0447\">\u0410.&#160;\u0424.&#160;\u0422\u0440\u0451\u0448\u043d\u0438\u043a\u043e\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1963_%D0%B3%D0%BE%D0%B4\" title=\"1963 \u0433\u043e\u0434\">1963<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D1%87%D0%B8%D0%BB%D0%BB%D1%8C,_%D0%A3%D0%B8%D0%BD%D1%81%D1%82%D0%BE%D0%BD\" title=\"\u0427\u0435\u0440\u0447\u0438\u043b\u043b\u044c, \u0423\u0438\u043d\u0441\u0442\u043e\u043d\">\u0423\u0438\u043d\u0441\u0442\u043e\u043d \u0427\u0435\u0440\u0447\u0438\u043b\u043b\u044c<\/a> \u0441\u0442\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u043c \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u0446\u0435\u043c, \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81_%D0%A1%D0%A8%D0%90\" title=\"\u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u0421\u0428\u0410\">\u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u0421\u0428\u0410<\/a> \u043f\u0440\u0438\u0441\u0432\u043e\u0438\u043b \u0437\u0432\u0430\u043d\u0438\u0435 \u043f\u043e\u0447\u0451\u0442\u043d\u043e\u0433\u043e \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0438\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%82%D0%B8%D0%BA%D0%B0%D0%BD\" title=\"\u0412\u0430\u0442\u0438\u043a\u0430\u043d\">\u0412\u0430\u0442\u0438\u043a\u0430\u043d<\/a> \u043e\u0442\u043c\u0435\u043d\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B5%D0%BA%D1%81_%D0%B7%D0%B0%D0%BF%D1%80%D0%B5%D1%89%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%BA%D0%BD%D0%B8%D0%B3\" title=\"\u0418\u043d\u0434\u0435\u043a\u0441 \u0437\u0430\u043f\u0440\u0435\u0449\u0451\u043d\u043d\u044b\u0445 \u043a\u043d\u0438\u0433\">\u0418\u043d\u0434\u0435\u043a\u0441 \u0437\u0430\u043f\u0440\u0435\u0449\u0451\u043d\u043d\u044b\u0445 \u043a\u043d\u0438\u0433<\/a>, \u043f\u0440\u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u0432\u0448\u0438\u0439 \u0431\u043e\u043b\u0435\u0435 \u0447\u0435\u0442\u044b\u0440\u0451\u0445 \u0432\u0435\u043a\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%85%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B0%D0%BA%D0%B8%D1%8F\" title=\"\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u044f\">\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u0438<\/a> \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u043d\u044b\u0439 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442 \u00ab\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u0446\u043a\u0438\u0439 \u043f\u0443\u0442\u044c \u043a \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0437\u043c\u0443\u00bb, \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u0432\u0448\u0438\u0439 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \